Given g.f. A(x), A(x)/x is the unique solution to variable A in the infinite system of simultaneous equations starting with:
. A = 1 + xB^2 + x^2*C^3;
. B = A + xC^2 + x^2*D^3;
. C = B + xD^2 + x^2*E^3;
. D = C + xE^2 + x^2*F^3; ...
. also B = A(A(x))/x, C = A(A(A(x)))/x, D = A(A(A(A(x))))/x, etc.

