Let A_n(x) denote the n-th iteration of g.f. A(x), then A(x) satisfies:
. A(A(x)) = Sum_{n>=0} A_{n+1}(x) * A(A(x))^n;
. A_k(x) = Sum_{n>=0} A_{n+k-1}(x) * A_k(x)^n for all k;
. A_{-1}(x) = x - Sum_{n>=1} A_{n-1}(x)*x^n = series reversion of A(x).

a(n) = floor(n*(3 + sqrt(3))).
From Miko Labalan, Dec 17 2016: (Start)
a(n) = 3n + A022838(n);
For n > 0, a(n) = 5*floor(n*(sqrt(3)-1)) + 4*floor(n*(2-sqrt(3))) + 4;
a(0) = 0, a(n) = a(n - 1) + A022838(n) - A022838(n - 1) + 3.
(End)

Conjecture: the positions of the records of the positive integers in A179319 are given by:
* a(2n-1) = A059973(4n+1) - 2 for n>1, with a(1) = 0;
* a(2n) = A059973(4n+2) - 2 for n>=1.

Conjecture: the positions of the records of the negative integers in A179319 are given by:
* a(2n-1) = A059973(4n-1) - 1 for n>=1;
* a(2n) = A059973(4n) - 1 for n>=1.

 G.f. A(x), along with F(x) = A(x/F(x)) and G(x) = A(x*G(x)), satisfy:
* A(x/A(x)) = 1 + x*F(x/A(x)) since G(x/A(x)) = A(x);
* A(x*A(x)) = 1 + x*A(x)^2*G(x*A(x)) since F(x*A(x)) = A(x);
* A(x/F(x)^2) = 1 + x*F( x/F(x)^2 )/F(x) since F(x) = G(x/F(x)^2);
* A(x*G(x)^2) = 1 + x*G(x)^3*G( x*G(x)^2 ) since G(x) = F(x*G(x)^2).

A = sqrt(s*(p-a)*(s-b)*(s-c)) with s = (a+b+c)/2 (Heron's formula);
the inradius is r=A/s;
the exradii of the excircles are r1 = 2*A/(-a+b+c), x2 = 2*A*b/(a-b+c), and x3 = 2*A*c/(a+b-c).

G.f.: A(x) = G(x) + G(x)^2 where
* G(x) = (sqrt(1 + 4*A(x)) - 1)/2;
* G(x) = Series_Reversion(x - A(x)^2).

a(n) = 4n + floor(n*sqrt(3)).
From Miko Labalan, Dec 17 2016: (Start)
a(n) = floor(n*(4+sqrt(3))) = 4n+A022838(n);
For n > 0, a(n) = 6*floor(n*(sqrt(3)-1)) + 5*floor(n*(2-sqrt(3))) + 5;
a(0) = 0, a(n) = a(n - 1) + A022838(n) - A022838(n - 1) + 4.
(End)

G.f. A(x) satisfies:
* A(x) = 1 + Sum_{n>=1} q^(n*(n+1)/2)/(1 - q^n), where q = x*A(x);
* A(x) = 1 + Sum_{n>=1} q^n/(1 - q^(2n)), where q = x*A(x);
* A(x) = 1 + Sum_{n>=1} A001227(n)*x^n*A(x)^n, where A001227(n) = number of odd divisors of n.
Let D(x) = 1 + Sum_{n>=1} A001227(n)*x^n, then
* A(x) = D(x*A(x)) and D(x) = A(x/D(x));
* A(x) = (1/x)*Series_Reversion(x/D(x));
* a(n) = [x^n] D(x)^(n+1)/(n+1), the coefficient of x^n in D(x)^(n+1)/(n+1) for n>=0.
